import React from "react";
import "./PlaylistCard.css";
import { useNavigate } from "react-router-dom";
function PlaylistCard({ playlistData }) {
  const navigate = useNavigate();
  console.log(playlistData);

  const playlistClickHandler = () => {
    navigate(playlistData.data.uri);
  };

  return (
    <div className="playlist-card" onClick={playlistClickHandler}>
      <img
        src="https://i.pinimg.com/originals/cb/8b/98/cb8b98b0aeb733b3af8f4f4d6fe9cb83.jpg"
        alt=""
        className="playlist-img"
      />
      <div className="playlist-content">
        <h3>{playlistData.data.name}</h3>
        <p>Created by: {playlistData.data.owner.name}</p>
        <a
          href="spotify:playlist:3ReHorJlnS1A510VDK9S3v"
          target="_blank"
          rel="noopener noreferrer"
        >
          lsl
        </a>
      </div>
    </div>
  );
}

export default PlaylistCard;
